    puts TypeProcess.find(8329).update(id: 8329,facts: 'ESTEFANY TORO ARIZMENDI SE ENCONTRABA EN EL REGIMEN ESPECIAL DE PRESTACIONES DE SALUD DE LA NACION MINISTERIO DE DEFENSA NACIONAL POLICIA NACIONAL DIRECCION DE SANIDAD. TRAS PRESENTAR UN DOLOR LUMBAR ESTEFANY TORO ES REMITIDA A UN ORTOPEDISTA EN EL HOSPITAL SANTA MONICA DEL MUNICIPIO DE DOSQUEBRADAS RISARALDA DONDE SE MANIFIESTA QUE LA NINA TENIA ESCOLIOSIS IDIOPATICA JUVENIL. ES TRANSFERIDA A LA CAJA DE COMPENSACION FAMILIAR DE RISARALDA PARA UNA VALORACION EL 6 DE JULIO DE 2012 DONDE FUE ATENDIDA POR EL MEDICO JOSE BERNARDO VACA EL CUAL ESTABLECE QUE NECESITABA CON URGENCIA UN CORSE. PARA OCTUBRE DE 2012 EL CORSE NO SE LE HABIA ENTREGADO A LA PACIENTE DE PARTE DE LA NACION MINISTERIO DE DEFENSA NACIONAL POLICIA NACIONAL DIRECCION DE SANIDAD. EN UN CONTROL POSTERIOR EN CAJA DE COMPENSACION FAMILIAR DE RISARALDA SE EVIDENCIO QUE LA ESCOLIOSIS HABIA AUMENTADO Y SE DETERMINO QUE LA NINA DEBIA SER OPERADA. EL 23 DE NOVIEMBRE DE 2013 SE PROCEDIO CON LA INTERVENCION QUIRURGICA DONDE POR LA COLOCACION DEL CATETER VENOSO CENTRAL SE LESIONA LA ARTERIA SUBCLAVIA IZQUIERDA ACONTECIMIENTO QUE NO FUE ESTIPULADO EN LA HISTORIA CLINICA. POSTERIOR A LA INTERVENCION QUIRURGICA LA PACIENTE PRESENTA APNEAS SINDROME CONVULSIVO Y DESVIACION DE LA MIRADA A LA IZQUIERDA. EL 24 DE NOVIEMBRE DE 2013 LA PACIENTE INGRESA A LA UCI PEDIATRICA UNIKIDS DE CAJA DE COMPENSACION FAMILIAR DE RISARALDA DONDE DESPUES DE LA REALIZACION DE UN TAC SE TOMA LA DECISION DE VOLVER A INTERVENIR QUIRURGICAMENTE A LA PACIENTE CON EL FIN DE RETIRAR EL MATERIAL QUE SE LE HABIA COLOCADO. SE ESTABLECE QUE LA PACIENTE SE ENCUENTRA CON ANISOCORIA CON EDEMA CEREBRAL CON COMPONENTE OBSTRUCTIVO. EL 25 DE NOVIEMBRE DE 2013 LA PACIENTE ES EVALUADA POR DOCTORES DE NEUROPEDIATRIA Y NEUROCIRUGIA QUIENES ESTABLECEN MAL PRONOSTICO Y DECRETAN MUERTE CEREBRAL EL MISMO DIA A LAS 22 HORAS ESTEFANY TORO FALLECE',state_db: 'REGISTRO MIGRADO SOBRESCRITO')
